import React from 'react';

class Textbox extends React.Component {
    render() {
        return (
            <div className = "entry">
            <input
                type = "text"
                placeholder = "Input"
            />
            <button type = "submit" className = "inputButton">
                <i> Submit </i>
            </button>
        </div>
        );
    }
}
